/*! Kernel Functions */
function blueScreen(error) {
	$('body').attr('style','');
	$('body').css({'background-color':'blue','font-family':'Courier','color':'white'});
	$('body').html('Webdows (c) 2015 - 2017<br><br>A problem has been detected and Webdows has been halted.<br><br>If this is the first time you\'ve seen this error screen, refresh your browser. If this screen appears again, follow these steps:<br>Check to make sure any new software is properly written (HTTP errors, syntax errors, ect). If problems continue, try resetting Webdows: <a style="color:white;" href="#" onclick="system.registry.set();window.location.reload();">(Reset)</a>.<br><br>Technical information:<br><br>');
	$('body').append(error);
}
var legacySetInterval = setInterval;
setInterval = function(callback, interval) {
	var id = legacySetInterval(callback, interval);
	system.intervals[id] = {
		callback : callback,
		interval : interval
	}
	return id;
};
var legacyClearInterval = clearInterval;
clearInterval = function(id) {
	legacyClearInterval(id);
	delete system.intervals[id];
};
/*! Remove NO SCRIPT */
$('noscript').remove();
/*! Error Handler */
window.onerror = function(message, source) {
	system.error(message, 'onerror '+source);
};
$(document).ajaxError(function(e, jqxhr, s, error) {
	system.error('HTTP Status: '+jqxhr.status+'<br>'+error, 'ajaxError '+s.url);
});
/*! System Class */
var system = {
	formatAMPM : function(date) {
		var hours = date.getHours();
		var minutes = date.getMinutes();
		var ampm = hours >= 12 ? 'PM' : 'AM';
		hours = hours % 12;
		hours = hours ? hours : 12;
		minutes = minutes < 10 ? '0'+minutes : minutes;
		var strTime = hours + ':' + minutes + ' ' + ampm;
		return strTime;
	},
	error : function(errorMessage, filePath) {
		if(typeof explorer !== 'undefined') {
			var errorWin = new explorer.window()
			.center()
			.title('ERROR: '+filePath)
			.icon('webdows/resources/icons/aler.ico')
			.body
			.html(filePath+'<hr>'+errorMessage)
			.css({'padding':'10px'});
		} else {
			blueScreen('SYSTEMHALT @ '+filePath+'<br><br>'+errorMessage);
		}
	},
	service : function() {
		var path = '';
		var id = system.guid();
		var interval = 5000;
		var intervalID = undefined;
		var autoStart = false;
		var run = false;
		this.updateRegistry = function() {
			system.registry.set('HKEY_LOCAL_WEBDOWS/system/services/'+id, {'path': path, 'interval': interval, 'autoStart': autoStart});
			return this;
		};
		this.registerService = function() {
			system.services[id] = this;
			this.updateRegistry();
			return this;
		};
		this.unregisterService = function() {
			this.run(false);
			delete system.services[id];
			system.registry.set('HKEY_LOCAL_WEBDOWS/system/services/'+id);
		};
		this.path = function(setPath) {
			if(typeof setPath == 'string') {
				path = setPath;
				if(this.run()) {
					this.run(false).run(true);
				}
				return this.updateRegistry();
			} else {
				return path;
			}
		};
		this.autoStart = function(bool) {
			if(typeof bool == 'boolean') {
				autoStart = bool;
				return this.updateRegistry();
			} else {
				return autoStart;
			}
		};
		this.interval = function(setInterval) {
			if(typeof setInterval == 'number') {
				interval = setInterval;
				if(this.run()) {
					this.run(false).run(true);
				}
				return this.updateRegistry();
			} else {
				return interval;
			}
		};
		this.run = function(bool) {
			if(typeof bool == 'boolean') {
				if(bool && !this.run()) {
					if(typeof path == 'string' && typeof interval == 'number') {
						run = true;
						this.updateRegistry();
						var service = this;
						$.ajax({
							type: "GET",
							url: path,
							dataType: "text",
							cache: true
						}).done(function(data) {
							intervalID = setInterval(function() {
								try {
									(function() {
										eval(data);
									})();
								} catch(e) {
									service.run(false);
									system.error(e, 'system.service: '+service.id());
								}
							}, interval);
						});
					} else {
						run = false;
						system.error('Cannot start service. Missing path, or interval.<br><br>ServiceID: '+id, path);
					}
				} else if(this.run()) {
					clearInterval(intervalID);
					run = false;
					this.updateRegistry();
				}
				return this;
			} else {
				return run;
			}
		};
		this.id = function(setID) {
			if(typeof setID == 'string') {
				this.unregisterService();
				id = setID;
				return this.registerService();
			} else {
				return id;
			}
		};
		this.registerService();
	},
	services : {},
	intervals : {},
	registry : {
		set : function(key, value) {
			if(typeof key == 'undefined' || key == '') {
				key = '';
			}
			while(key.startsWith('/')) {
				key = key.substr(1);
			}
			while(key.endsWith('/')) {
				key = key.slice(0, -1);
			}
			$.each(localStorage, function(k) {
				if(key == '') {
					localStorage.removeItem(k); 
				}
				if(k.startsWith(key+'/')) {
					localStorage.removeItem(k); 
				}
				if(k == key) {
					localStorage.removeItem(k); 
				}
			});
			if(typeof value !== 'undefined') {
				if(typeof value == 'object') {
					if(key !== '') {
						key = key + '/';
					}
					$.each(value, function(k) {
						system.registry.set(key+k, this.valueOf());					   
					});
				} else {
					localStorage.setItem(key, value);   
				}
			}
		},
		get : function(key) {
			var ret = {};
			if(typeof key == 'undefined') {
				key = '';
			}
			$.each(localStorage, function(k) {
				if(key == '' || k == key || k.startsWith(key+'/')) {
					var path = '';
					if(k.startsWith(key+'/')) {
						path = key+'/';
					} else {
						path = key;
					}
					k = k.replace(path, '');
					var split = k.split('/');
					var next = k.split('/').shift();
					if(split.length == 1) {
						var data = this.valueOf();
						if(k == '') {
							ret = data;
							return false;
						} else {
							ret[k] = data;
						}
					} else if(typeof ret[next] !== 'object') {
						if(next == '') {
							ret = system.registry.get(path+next+'/');
							return false;
						} else {
							ret[next] = system.registry.get(path+next);
							
						}
					}
				}
			});
			if($.isEmptyObject(ret)) {
				ret = undefined;
			}
			return ret;
		}
	},
	is : {
		mobile : function() {
			var ret = false;
				if(typeof window.orientation !== 'undefined'){
					ret = true;
				}
			return ret;
		}
	},
	guid : function() {
		function s4() {
			return Math.floor((1 + Math.random()) * 0x10000).toString(16).substring(1);
		}
		return 'WKGUID'+s4()+s4()+s4()+s4()+s4()+s4()+s4()+s4();
	},
	loader : function(path, args, callback) {
		var successTF = false;
		if(typeof args == 'function') {
			callback = args;
			args = {};
		}
		path = path+'';
		var split = path.split('/');
		var file = split[split.length - 1];
		var folder = path.replace(file, '');
		return $.ajax({
			type: "GET",
			url: path,
			dataType: "text",
			cache: true
		}).done(function(data) {
			var loader = {};
			loader.path = path;
			loader.folder = folder;
			loader.file = file;
			loader.args = args;
			try {
				(function(loader) {
					eval(data);
				})(loader);
				successTF = true;
			} catch(e) {
				system.error(e, 'system.loader '+path);
			}
		}).always(function() {
			if(typeof callback !== 'undefined') {
				callback.call(successTF);
			}
		});
	},
	legacyLoader : function(path, callback) {
		return $.ajax({
			url: path,
			dataType: 'script',
			async: true,
			cache: true
		}).always(function() {
			if(typeof callback !== 'undefined') {
				callback.call();
			}
		});
	}
};
